import React from 'react';

class Login extends React.Component{

    constructor(props){
        super(props);
        this.state={
            name:"",
            password:"",
        };
        this.onChange=this.onChange.bind(this);
    }
    onChange(event){
 this.setState({name:event.target.value});
    }


    render(){
        return (
                <div className="project">
                  <div className="container">
                        <div className="row">
                            <div className="col-md-8 m-auto">
                                <h5 className="display-4 text-center">User Login Form</h5>
                                <hr></hr>
                                <form>
                                        <div className="form-group">
                                             <input type="text" name="name" value={this.state.name}
                                             className="form-control form-control-lg" onChange={this.onChange}
                                             placeholder="User Name"></input>

                                        </div>
                                       
                                        <div className="form-group">
                                             <input type="text" value={this.state.password}  name="password" className="form-control form-control-lg" placeholder="Password"></input>
                                        </div>
                                        <input type="submit" className="btn btn-primary btn-black mt-4" name="login" value="Login" />
                                       
                                </form>
                            </div>
                        </div>
                  </div>
                </div>
            

        );
    }
}

export default Login;
